import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import HomePage from "./pages/HomePage";
import AuthPage from "./pages/AuthPage";
import PrescriptionUploadPage from "./pages/PrescriptionUploadPage";
import PharmacyAccessPage from "./pages/PharmacyAccessPage";
import MedicineVerificationPage from "./pages/MedicineVerificationPage";

const App = () => {
  return (
    <Router>
      <Navbar />
      <Routes>
        {/* Default Route (Initial Page) */}
        <Route path="/" element={<HomePage />} />

        {/* Other Routes */}
        <Route path="/auth" element={<AuthPage />} />
        <Route path="/upload-prescription" element={<PrescriptionUploadPage />} />
        <Route path="/pharmacy-access" element={<PharmacyAccessPage />} />
        <Route path="/medicine-verification" element={<MedicineVerificationPage />} />
      </Routes>
    </Router>
  );
};

export default App;
